const { Client, Partials, GatewayIntentBits, Collection, WebhookClient, EmbedBuilder, ShardEvents, codeBlock } = require('discord.js');
const fs = require('fs');
const I18n = require('@soydaddy/i18n');
const YAML = require('yaml');
const { join } = require('path');
const { ClusterClient, getInfo } = require("discord-hybrid-sharding");
const { textColored } = require('./lib/function')

// Discord client
const client = new Client({
    shards: getInfo().SHARD_LIST, 
    shardCount: getInfo().TOTAL_SHARDS,
    allowedMentions: {
        parse: [
            'users',
            'roles',
            "everyone"
        ],
        repliedUser: true
    },
    autoReconnect: true,
    disabledEvents: [
        "TYPING_START"
    ],
    partials: [
        Partials.Channel,
        Partials.GuildMember,
        Partials.Message,
        Partials.Reaction,
        Partials.User,
        Partials.GuildScheduledEvent
    ],
    intents: [
        GatewayIntentBits.Guilds,
        GatewayIntentBits.GuildMembers,
        GatewayIntentBits.GuildBans,
        GatewayIntentBits.GuildEmojisAndStickers,
        GatewayIntentBits.GuildIntegrations,
        GatewayIntentBits.GuildWebhooks,
        GatewayIntentBits.GuildInvites,
        GatewayIntentBits.GuildVoiceStates,
        GatewayIntentBits.GuildMessages,
        GatewayIntentBits.GuildMessageReactions,
        GatewayIntentBits.GuildMessageTyping,
        GatewayIntentBits.DirectMessages,
        GatewayIntentBits.DirectMessageReactions,
        GatewayIntentBits.DirectMessageTyping,
        GatewayIntentBits.GuildScheduledEvents,
        GatewayIntentBits.MessageContent,
        GatewayIntentBits.GuildVoiceStates,
        GatewayIntentBits.GuildPresences
    ],
    restTimeOffset: 0
});

// Connect to database
require("./database/connect")();

// Language system
const locales = {};
fs.readdirSync(join(__dirname, 'locales')).filter(file => file.endsWith('.yml')).forEach(file => {
    const data = fs.readFileSync(join(__dirname, 'locales/' + file), { encoding: 'utf8' });
	const name = file.slice(0, file.length - 4);
	locales[name] = YAML.parse(data);
});
const trad = new I18n('en-US', locales)
global.i18n = trad;

// Client settings
client.config = require('./config/bot');
client.emotes = require("./config/emojis.json");
client.webhooks = require("./config/webhooks.json");

// Collections
client.Premium = new Collection();
client.commands = new Collection();

// Load handlers
fs.readdirSync('./src/handlers').forEach((dir) => {
    fs.readdirSync(`./src/handlers/${dir}`).forEach((handler) => {
        require(`./handlers/${dir}/${handler}`)(client);
    }); 
});
